import React from 'react'

export default function Categories(props) {

    // console.log(props)
    return (
        <div>
            <table className="table">
                <tr>
                <td>{props.name}</td>
                <td>{props.duration}</td>
                </tr>
                <button>Edit</button>
                <button>Delete</button>
            </table>
        </div>
    )
}
